    <div><h5>Title : <span>{data[no].title}</span></h5>
    <h5>Publisher : <span>{data[no].publisher}</span></h5>
    <h5>Genre :<span>{data[no].genre}</span></h5></div></a>
    </div></>
  )
}

export default Gameinfo
